import React, {Component} from 'react';

class App extends Component{
  constructor(){
    super()
    this.state = {
      isLoggedIn:false
    }
  }
  render(){
    return (
      <div>
          <h1>You are Currently logged {this.state.isLoggedIn}</h1>
      </div>
    )
  }
}


export default App;
